features.script:
// NOTE: ADD LOWER CASE FOR NAME INPUT MATCHING
// NOTE: line_size NOT WORKING! FOR SOME REASON SHOWING UP AS UNDEFINED
let GRT_plot = parcel.getFeatureById('GRT_plot')

// OLD TEST WITH LINE SIZE BUTTONS: (deprecated for input)
//let line_plus = parcel.getFeatureById('line_plus')
//let line_minus = parcel.getFeatureById('line_minus')

//let line_size = 2

//change line size
//line_plus.on('click',e=>{
//  line_size = line_size + 1
//})
//line_minus.on('click',e=>{
//  line_size = line_size - 1
//})

//let line_size = parcel.getFeatureById('line_size').text
//^ WHY IS THIS UNDEFINED? line_size NOT WORKING
let line_size = parcel.getFeatureById('line_size')


feature.on('click',e=>{

  console.log(parcel.getFeatureById('subgraph_name').text)

  if(parcel.getFeatureById('subgraph_name').text == undefined && parcel.getFeatureById('plot_color').text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/curation_signal_to_rewards?point_size="+line_size.text})

  } else if(parcel.getFeatureById('plot_color').text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/curation_signal_to_rewards?subgraph_select="+parcel.getFeatureById('subgraph_name').text+"&point_size="+line_size.text})
  } else if(parcel.getFeatureById('subgraph_name').text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/curation_signal_to_rewards?plot_color="+parcel.getFeatureById('plot_color').text+"&point_size="+line_size.text})
  } 
  else{
     GRT_plot.set({'url':"http://r-cv-api.org/hello/curation_signal_to_rewards?subgraph_select="+parcel.getFeatureById('subgraph_name').text+"&plot_color="+parcel.getFeatureById('plot_color').text+"&point_size="+line_size.text})

     console.log("http://r-cv-api.org/hello/curation_signal_to_rewards?subgraph_select="+parcel.getFeatureById('subgraph_name').text+"&plot_color="+parcel.getFeatureById('plot_color').text+"&point_size="+line_size.text)
  }

})

let GRT_plot = parcel.getFeatureById('chart_selector_img')
let stat_visualize = parcel.getFeatureById('stat_visualize')
let days_back = parcel.getFeatureById('days_back')
// prophet model
let days_out = parcel.getFeatureById('days_out')
let prophet_chart = parcel.getFeatureById('prophet_chart')

feature.on('click',e=>{

  console.log(stat_visualize.text)
  // checkmark label
let checkmark = parcel.getFeatureById('checkmark_label')
let checkmark_option = 1
// set to no labels if it's in the off position
if(checkmark.position.x == -5.75){
  checkmark_option = 0
}

  if(stat_visualize.text == undefined && days_back.text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/pins_plot_GRT_stats?label="+checkmark_option})

  } else if(days_back.text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/pins_plot_GRT_stats?var_plot="+stat_visualize.text+"&label="+checkmark_option})
  } else if(stat_visualize.text == undefined){
    GRT_plot.set({'url':"http://r-cv-api.org/hello/pins_plot_GRT_stats?last_n_days="+days_back.text+"&label="+checkmark_option})
  } 
  else{
     GRT_plot.set({'url':"http://r-cv-api.org/hello/pins_plot_GRT_stats?var_plot="+stat_visualize.text+"&last_n_days="+days_back.text+"&label="+checkmark_option})
  }

  // now facebook prophet model
  if (stat_visualize.text == undefined && days_out.text == undefined){
    prophet_chart.set({'url':"http://r-cv-api.org/hello/prophet_GRT_stats"})
  } else if(days_out.text == undefined){
    prophet_chart.set({'url':"http://r-cv-api.org/hello/prophet_GRT_stats?var_plot="+stat_visualize.text})
  } else if (stat_visualize.text == undefined){
    prophet_chart.set({'url':"http://r-cv-api.org/hello/prophet_GRT_stats?days_out="+days_out.text})
  } else{
     prophet_chart.set({'url':"http://r-cv-api.org/hello/prophet_GRT_stats?var_plot="+stat_visualize.text+"&days_out="+days_out.text})
  }

})

